B.Lx=new A.r(9,{id:1,question:"What is a manifest file?",answer:'It is a configuration file for an Android app. The manifest file is  **where you can declare what components, mention permissions your app requires**, and thus, which types of devices your app is compatible with. It also describes the entry points to your app (using intent-filter)\n\n> **Tip:** You can also mention about **manifestPlaceholders** \n\nIt allows you to create something like variables that can be used in the app\u2019s `AndroidManifest.xml` file. For example, we want to have different app labels for different build types. Let\u2019s say the app label should have a \u2018debug\u2019 suffix for `debug` build types. For this, we need to add the next code in our app `build.gradle` in the `buildTypes` section.\n\n`manifestPlaceholders = [appLabel: "AwesomeApp debug"]`\n\nNow we can use `appLabel` placeholder in our Manifest to change the app\u2019s label according to selected `buildType`!\n\n`<application  \nandroid:label=\u201d\\${appLabel}\u201d ...  >`',category:"Android",topic:"Basics",level:0,uploader:"Oleksandr",sociallink:"https://medium.com/@zephyr.ventum",profileImage:"https://i.pinimg.com/originals/1d/17/81/1d178185467d1f0a43cee643db985c36.jpg"},B.Is,t.M)
