B.O1=new A.r(7,{id:1675766541874,question:"What is ClickJacking?",answer:"- **ClickJacking** is a security attack where the user is fooled to click on something while they assume they are clicking another thing. \n- The attack mostly happens by the HTML frames. ClickJacking is also regarded as the user interface redressing. \n- It lets the user think that they are utilising a normal UI in the web page, but in actuality, there is an unseen UI in control; you can think of it as the user interface being redressed.\n-  When users click on one thing, assuming it to be secure and safe, the hidden UI executes another action.\n\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.e,t.M)
B.MM=new A.r(7,{id:1675766651378,question:"Mention three ways to decrease page load time?",answer:"There are numerous things accountable for lowering page load time. Let us look at the three best ways to reduce its loading time:\n\n- **Image Optimization**: It is always advised to scale your videos and pictures before uploading them to a page.\n- **Browser Cache**: The utilization of cache will boost speed for pages that you have visited already.\n- **Optimize and compress content**: Compressing the content of a website decreases the load time of a page to a great extent.\n- **StyleSheet Reference on Top**: Setting stylesheet reference to the header of a doc allows your page to load quickly.\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.e,t.M)
B.Mt=new A.r(7,{id:1675766805669,question:"Tell me when and why should I make use of Webpack?",answer:"- While creating a complicated front-end application with tons of non-code static possessions, for instance, CSS, fonts, images, etc, then, of course, you should make use of Webpack since it has a lot of amazing benefits.\n\n- If you have a small application that doesn't have a lot of static resources and you only have to create one file of JavaScript to help the customers, then Webpack should be more overhead than needed.\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.e,t.M)
B.Mq=new A.r(7,{id:1675766887809,question:"How does the server hanger the page in which content is present in several languages?",answer:'- When an HTTP request is sent to the server by the user, the user browser also sends a chunk of additional information regarding the language preference as the Accept-Language header. \n- Then the server reads the HTTP request with the Accept-Language header and sends the document version back along with the right language and declares the language attribute Lang in the HTML tag.\n\n```\n<html lang = "hi">...</html>\n```\n\n',category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.OQ=new A.r(7,{id:1675768992514,question:"State all the elements of the CSS Box Model.",answer:"        \nIn its BOX model, CSS comprises 4 elements:\n\n**Padding** \u2013 This area encircles the content.\n\n**Margin** \u2013 Margin is the area outside the border.\n\n**Border** \u2013 The border is the padding's outer layer.\n\n**Content** \u2013 Displays the main content and the text of the web page.\n\n\n![enter image description here](https://miro.medium.com/max/399/1*LCWYi8UVXqF24rgU-8sPHA.jpeg)\n\n\n\n    ",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.e,t.M)
B.OD=new A.r(7,{id:1675770122708,question:"Suggest some ways on how to fix the browser-specific styling issue?",answer:"- We can make a distinctive stylesheet for various browsers making use of server-side rendering.\n- Utilizing a library such as Bootstrap, which already has the code to manage the browser-specific styling issue.\n- Reset or Normalize CSS can also be utilized. Multiple 3rd party plugins equip libraries for browser styling issues.\n",category:"Web Frontend",topic:"Web Basics",level:1,uploader:"Pankaj Venkata"},B.e,t.M)
B.NN=new A.r(7,{id:1675770278187,question:"Suggest how can we optimize our front-end page.",answer:"- The consumption of resources can be reduced by the pages by enhancing the server response.\n- Utilize JavaScript and External CSS instead of internal or in-line.\n- Utilize the framework to ensure the front-end becomes more responsive to different devices.\n- Open-source libraries can be used to manage the browser-specific styling issue.\n- Make use of progressive loading like Lazy Loading to enhance the rendering of heavy elements, like videos and images.\n- Connect the style sheet in the header and script at the top of the HTML's body tag.\n- Utilize browser storage to keep user-specific private data.",category:"Web Frontend",topic:"Web Basics",level:1,uploader:"Gobind Sekhar"},B.e,t.M)
B.LT=new A.r(7,{id:1675770414425,question:"What is 'strict mode' in JavaScript?",answer:"Strict mode can be used to enforce the restricted variant of JavaScript along with non-strict mode code or alone. It can be applied to the entire script or individual functions and won't be applicable to block statements enclosed in { }.\n\nExample (strict mode for the entire script)\n```\n'use strict';\nconst name = 'devinterview';\n```\n\nExample (strict mode for a function)\n```\nfunction user(){\n    'use strict';\n    console.log(\"Strict mode\");\n}\n```\n",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.N_=new A.r(7,{id:1675770669817,question:"What is Object Destructuring in JavaScript?",answer:"Object Destructuring or destructuring assignment is an approach by which the properties from an object or values from an array can be directly unpacked to different variables.\n\nExample (Without Object Destructuring)\n```\nconst course = {\n    name: 'Introduction to JavaScript',\n    isPaid: true,\n    cost: {\n        amount: 999,\n        currency: 'INR'\n    }\n};\nconst name = course.name;\nconst isPaid = course.isPaid;\nconst cost = course.cost;\nconsole.log(name); // Introduction to JavaScript\nconsole.log(isPaid); // true\nconsole.log(cost); // { amount: 999, currency: 'INR' }\n```\n\nExample (With Object Destructuring)\n```\nconst course = {\n    name: 'Introduction to JavaScript',\n    isPaid: true,\n    cost: {\n        amount: 999,\n        currency: 'INR'\n    }\n};\nconst { name, isPaid, cost } = course; // destructuring is done here\nconsole.log(name); // Introduction to JavaScript\nconsole.log(isPaid); // true\nconsole.log(cost); // { amount: 999, currency: 'INR' }\nExample (With Object Destructuring and having alias for properties)\nconst course = {\n    name: 'Introduction to JavaScript',\n    isPaid: true,\n    cost: {\n        amount: 999,\n        currency: 'INR'\n    }\n};\nconst { name: courseName, isPaid, cost: courseCost } = course;\nconsole.log(courseName); // Introduction to JavaScript\nconsole.log(isPaid); // true\nconsole.log(courseCost); // { amount: 999, currency: 'INR' }\n```\nExample (Partial Object Destructuring)\n\n```\nconst course = {\n    name: 'Introduction to JavaScript',\n    website: 'devinterview.in',\n    isAwesome: true,\n    cost: 999\n};\nconst { name, cost, ...rest } = course;\nconsole.log(name); // Introduction to JavaScript\nconsole.log(cost); // 99\nconsole.log(rest); // { website: 'devinterview.in', isAwesome: true }\n```\nExample (Array Destructuring)\n```\nconst nums = [4, 5, 6, 7];\nconst [first, second, ...rest] = nums;\nconsole.log(first); // 4\nconsole.log(second); // 5\nconsole.log(rest); // [ 6, 7 ]\n```",category:"Web Frontend",topic:"Javascript",level:1,uploader:"Pankaj Venkata"},B.e,t.M)
B.Nw=new A.r(7,{id:1675770768570,question:"What is the difference between '==' and '===' in JavaScript?",answer:"The abstract equality operator (==) and strict equality operator (===) are both comparison operators. The '===' can be used to compare both values and types whereas '==' can be used to only compare values.\n\nExample\n```\nconst x = 0;\nconst y = '0';\n\nconsole.log(x === y);    // false\nconsole.log(x == y);     // true\n```",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.NO=new A.r(7,{id:1675770894337,question:"What are async functions in JavaScript?",answer:"Async functions are those functions using which asynchronous, promise-based behavior can be introduced without explicitly using a Promise.\n\nThe **await** expression is used along with the async functions. An async function can have zero or more await expressions. await is used to make the function appear to be synchronous until the promise is fulfilled or rejected.\n\nExample\n```\nfunction resolveAfter2Seconds() {\n  return new Promise(resolve => {\n    setTimeout(() => {\n      resolve('workattech');\n    }, 2000);\n  });\n}\n\nasync function asyncCall() {\n  const result = await resolveAfter2Seconds();\n  console.log(result);\n}\nasyncCall();     // calling the async function asyncCall() will output workattech after 2 seconds\n```",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Mitchell Jonah"},B.e,t.M)
B.O3=new A.r(7,{id:1675771027862,question:"What is the difference between 'null' and 'undefined' in JavaScript?",answer:"**undefined** is a primitive value that is assigned to a variable before it is initialized. In other words, if you declare a variable but don't initialize the value, it will appear to be undefined during code execution.\n\nThe value **null** can be assigned to any variable. It represents that the variable has no value.\n\nExamples\n\n\nconst x = null;\n  console.log(x);    // null\n\n\nlet x;\nconsole.log(x);    // undefined\n",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Mitchell Jonah"},B.e,t.M)
B.MB=new A.r(7,{id:1675771814327,question:"What is NaN in JavaScript?",answer:"- **NaN (Not-a-Number)** is a JavaScript property used to represent values that are not proper numbers. NaN is returned by numerical operations where the operation is unable to resolve a numerical value.\n\n- Examples\n```\nparseInt(\"thedevinterview.in\");\nMath.sqrt(-1);\n\"thedevinterview.in\"/3\n```\n- The isNaN() function can be used to check whether a value is NaN or not. While using the isNaN() function, the value will be first converted to a Number type. Then a check would happen to find out whether it is NaN or not.\n\n- Examples\n```\nisNaN(123);    // false\nisNaN('workattech');    // true\nisNaN('123');    // false \u2192 '123' is converted to Number type (123) and hence it is NaN\nisNaN(undefined);    // true\nisNaN(true);    // false \u2192 true is corresponding to 1, which is converted to Number type and checked\nisNaN(false);   // false\n```",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Mitchell Jonah"},B.e,t.M)
B.Ou=new A.r(7,{id:1675772015737,question:"What are var, const, let keywords in JavaScript?",answer:"- **var**, **const**, and **let** are the keywords that can be used to declare the variables in JavaScript.\n\n- **Scopes**:\n1. The 'var' keyword is globally and functionally scoped and it can be re-assigned.\n2. The 'let' keyword has functional and block scope and can also be re-assigned.\n3. The 'const' keyword also has functional and block scope but it cannot be re-assigned.\nNote that let can be used everywhere instead of const. A good practice to avoid bugs is to use const by default and use let when we are sure that the variable might get updated. Such bugs easily come up in large codebases.",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.MO=new A.r(7,{id:1675772235570,question:"What is the difference between map() and forEach() in JavaScript?",answer:"The **forEach()** method iterates over a list (or an array) and carries out some operations on each of the elements.\n\nExample\n```\nconst array = [1, 2, 3, 4, 5];\narray.forEach(element => {\n    console.log(element);\n});  // outputs every element of the array\n```\nThe **map()** method iterates over a list, applies some callback function to each element, and constructs an array from the results. It does not cause any change in the list on which it was called.\n\nExample\n```\nconst array = [1, 2, 3, 4, 5];\nconst map = array.map(element => element*element);\nconsole.log(map);  // outputs the square of each element as a new array\n```",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.Ob=new A.r(7,{id:1675772354457,question:"What is the purpose of the 'this' operator in JavaScript?",answer:"In JavaScript, the '**this**' keyword inside an object refers to that object itself. It is mainly used in functions and constructors to access the properties and functions of that object.\n\nExample\n```\nclass Person {\n    constructor(firstName, lastName) {\n        this.firstName = firstName;\n        this.lastName = lastName;\n    }\n    getFullName () {\n        return `${this.firstName} ${this.lastName}`;\n    }\n}\nconst person = new Person ('Elon', 'Musk');\nconsole.log(person.getFullName()); // Elon Musk\n\n```",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.Om=new A.r(7,{id:1675870884515,question:"What is JSX?",answer:"- **JSX** is a syntax extension of JavaScript. It is used with React to describe what the user interface should look like. \n- By using JSX, we can write HTML structures in the same file that contains JavaScript code.\n\n![JSX](https://www.simplilearn.com/ice9/free_resources_article_thumb/what-is-jsx.JPG)",category:"Web Frontend",topic:"React",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.NF=new A.r(7,{id:1675870941178,question:"Can web browsers read JSX directly?",answer:"- Web browsers cannot read JSX directly. This is because they are built to only read regular JS objects and JSX is not a regular JavaScript object \n- For a web browser to read a JSX file, the file needs to be transformed into a regular JavaScript object. For this, we use Babel.\n![babel](https://www.simplilearn.com/ice9/free_resources_article_thumb/babel.JPG)",category:"Web Frontend",topic:"React",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.Mh=new A.r(7,{id:1675871132982,question:"What is the virtual DOM?",answer:"- DOM stands for Document Object Model. The DOM represents an HTML document with a logical tree structure. Each branch of the tree ends in a node, and each node contains objects.\n\n![DOM](https://www.simplilearn.com/ice9/free_resources_article_thumb/virtualdom.JPG)\n- React keeps a lightweight representation of the real DOM in the memory, and that is known as the virtual DOM. \n- When the state of an object changes, the virtual DOM changes only that object in the real DOM, rather than updating all the objects. \n\n![virtual dom](https://www.simplilearn.com/ice9/free_resources_article_thumb/real-dom.JPG)\n\n> **Tip**: This question is frequenctly asked in interviews.",category:"Web Frontend",topic:"React",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.MI=new A.r(7,{id:1675871627114,question:"What is the difference between the ES6 and ES5 standards?",answer:"These are the few instances where ES6 syntax has changed from ES5 syntax:\n\n- **Components and Function**\n\nES5\n```\nvar DevComponent = React.createClass({\n    \n     render: function() {\n          return(\n           <h1>TheDevInterview<h1>  \n          ); \n       }\n})\n```\n\n\n\nES6\n```\nclass DevComponent extends ReactComponent{\n    \n     render() {\n          return(\n           <h1>TheDevInterview<h1>  \n          ); \n       }\n}\n```\n\n\n- **require vs import**\n\nES5\n```\nvar React = require('react');\n```\n\nES6\n```\nimport React from 'react';\n```\n",category:"Web Frontend",topic:"React",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.Ow=new A.r(7,{id:1675872296768,question:"What is Lambda Functions in Python? ",answer:"A **Lambda Function** is a small anonymous function. A lambda function can take any number of arguments, but can only have one expression.\n\n```\nx = lambda a : a + 1\nprint(x(5)) \n\nOutput: 6\n```\n",category:"Machine Learning",topic:"Python",level:0,uploader:"Abhijit"},B.e,t.M)
B.Mx=new A.r(7,{id:1675872440284,question:"What are the built-in types available In Python?",answer:"**Immutable type:**\n\n- numbers: int(), float(), complex()\n- immutable sequences: str(), tuple(), frozenset(), bytes()\n\n\n**Mutable type**:\n\n- mutable sequences: list(), bytearray()\n- set type: set()\n- mapping type: dict()\n- classes, class instances\n\n",category:"Machine Learning",topic:"Python",level:0,uploader:"Abhijit"},B.e,t.M)
B.N3=new A.r(7,{id:1675872520704,question:"When to use a tuple vs list vs dictionary in Python?",answer:"- **Tuple** to store a sequence of items that will not change.\n- **List** to store a sequence of items that may change.\n- **Dictionary** when you want to associate pairs of two items.",category:"Machine Learning",topic:"Python",level:0,uploader:"Abhijit"},B.e,t.M)
B.Me=new A.r(7,{id:1675872702125,question:"What is Data Leakage and how do you avoid it in Scikit-Learn? ",answer:"**Data leakage** occurs when information that would not be available at prediction time is used when building the model. This results in overly optimistic performance estimates. To avoid this problem we should:\n\n- Always split the data into train and test subsets first, particularly before any preprocessing steps.\n\n- Never include test data when using the _fit_ and _fit_transform_ methods. Conversely, the transform method should be used on both train and test subsets as the same preprocessing should be applied to all the data. This can be achieved by using _fit_transform_ on the train subset and transform on the test subset.\n\n- Using _scikit-learn pipeline_ to ensure that the appropriate method is performed on the correct data subset.",category:"Machine Learning",topic:"Scikit-Learn",level:0,uploader:"Abhijit"},B.e,t.M)
B.Mk=new A.r(7,{id:1675872817648,question:"How to obtain reproducible results across multiple program executions in Scikit-Learn?",answer:"- In order to obtain reproducible (i.e. constant) results across multiple program executions, we need to remove all uses of **random_state=None**, which is the default. \n- The recommended way is to declare a **rng** variable at the top of the program, and pass it down to any object that accepts a random_state parameter. For example,\n```\n>>> rng = np.random.RandomState(0)\n>>> X, y = make_classification(random_state=rng)\n>>> rf = RandomForestClassifier(random_state=rng)\nX_train, X_test, y_train, y_test = train_test_split(X, y random_state=rng)\n>>> rf.fit(X_train, y_train).score(X_test, y_test)\n0.84\n```\n- We are now guaranteed that the result of this script will always be **0.84**, no matter how many times we run it. Changing the global rng variable to a different value should affect the results, as expected.\n\n- It is also possible to declare the rng variable as an integer. This may however lead to less robust cross-validation results.",category:"Machine Learning",topic:"Scikit-Learn",level:0,uploader:"Abhijit"},B.e,t.M)
B.NU=new A.r(7,{id:1675872981343,question:"What's the difference between GridSearchCV and RandomSearchCV? What is the advantage of each one?   ",answer:"- **GridSearchCV** creates a grid over the search space and evaluates the model for all of the possible hyperparameters in the space.\n- Using GridSearchCV can take a lot computational wise since it has to train your model for each combination, often including cross-validation. So for each combination, it would train on k folds. This can often explode your computation time tremendously. \n- The benefit however is that if you run it on a broad parameter space you will get the best parameter settings possible. For example, in the following scenario:\n```\nparams = {\n  epoch = [20, 30, 40, 50], #those numbers are only for example\n  dense_layer_size = [20, 30], \n  second_danse_layer = [30, 40]    \n}\n```\n\n- GridSearch will try all the combinations of your parameters, in this case: (4 * 2 * 2) = 16 total of parameters.\n\n- In **RandomSearchCV** not all parameter values are tried out, but rather a fixed number of parameter settings is sampled from the specified distributions. \n- The number of parameter settings that are tried is given by **n_iter**. In this case, we select n_iter number of combinations and try then. Is useful if you already have a general idea of which hyperparameters you want to tune but are not yet quite sure which values to use.",category:"Machine Learning",topic:"Scikit-Learn",level:0,uploader:"Abhijit"},B.e,t.M)
B.LI=new A.r(7,{id:1675873123131,question:"How are iloc() and loc() different?",answer:"- **DataFrame.iloc** is a method used to retrieve data from a Data frame, and it is an integer position-based locator (from 0 to length-1 of the axis), but may also be used with a boolean array. \n- It takes input as integer, arrays of integers, a slice object, boolean array and functions.\n```\ndf.iloc[0]\n\ndf.iloc[-5:]\n\ndf.iloc[:, 2]    # the : in the first position indicates all rows\n\ndf.iloc[:3, :3] # The upper-left 3 X 3 entries (assuming df has 3+ rows and columns)\n```\n\n- **DataFrame.loc** gets rows (and/or columns) with particular labels. \n- It takes input as a single label, list of arrays and slice objects with labels.\n```\ndf = pd.DataFrame(index=['a', 'b', 'c'], columns=['time', 'date', 'name'])\ndf.loc['a']     # equivalent to df.iloc[0]\ndf.loc['b':, 'date']   # equivalent to df.iloc[1:, 1]\n```",category:"Machine Learning",topic:"Pandas",level:0,uploader:"Abhijit"},B.e,t.M)
B.OO=new A.r(7,{id:1675873246685,question:"How does the groupby() method works in Pandas?",answer:"   - In the first stage of the process, data contained in a pandas object, whether a Series, DataFrame, or otherwise, is split into groups based on one or more keys that we provide.\n\n- The splitting is performed on a particular axis of an object. For example, a DataFrame can be grouped on its rows (axis=0) or its columns (axis=1).\n\n- Once this is done, a function is applied to each group, producing a new value. Finally, the results of all those function applications are combined into a result object. The form of the resulting object will usually depend on what's being done to the data.\n\n- In the figure below, this process is illustrated for a simple group aggregation.\n\n![enter image description here](https://user-images.githubusercontent.com/53355899/144045594-1a5c3f78-4250-4ed8-9de3-ca3689fe08bf.png)\n\nSource: www.mlstack.cafe",category:"Machine Learning",topic:"Pandas",level:0,uploader:"Mandeep singh"},B.e,t.M)
B.M9=new A.r(7,{id:1675873334299,question:"Why do should make a copy of a DataFrame in Pandas?",answer:"- In general, it is safer to work on copies than on original DataFrames, except when you know that you won't be needing the original anymore and want to proceed with the manipulated version.\n\n- This is because in Pandas, indexing a DataFrame returns a reference to the initial DataFrame. Thus, changing the subset will change the initial DataFrame. Thus, you'd want to use the copy if you want to make sure the initial DataFrame shouldn't change.\n\n- Normally, you would still have some use for the original data frame to compare with the manipulated version, etc. Therefore, depending on the case it's a good practice to work on copies and merge at the end.",category:"Machine Learning",topic:"Pandas",level:0,uploader:"Mandeep singh"},B.e,t.M)
B.NR=new A.r(7,{id:1675873412606,question:"What is the default method of variable initialisation in tf.get_variable()?",answer:"- If the initializer is **None**, the default initializer passed in the variable scope will be used. If that one is None too, a glorot_uniform_initializer will be used. \n- The **glorot_uniform_initializer** function, initializes values from a uniform distribution.",category:"Machine Learning",topic:"TensorFlow",level:0,uploader:"Mandeep singh"},B.e,t.M)
B.Ns=new A.r(7,{id:1675873489421,question:"What is the difference between Dataset.from_tensors and Dataset.from_tensor_slices and when would you use each one?  ",answer:'- **from_tensors** combines the input and returns a dataset with a single element; can be used to construct a larger dataset from several small datasets, i.e., the size (length) of the final dataset becomes larger;\n```\n>>> t = tf.constant([[1, 2], [3, 4]])\n>>> ds = tf.data.Dataset.from_tensors(t)\n>>> [x for x in ds]\n    [<tf.Tensor: shape=(2, 2), dtype=int32, numpy=\n    array([[1, 2],\n            [3, 4]], dtype=int32)>]\n\n```\n- **from_tensor_slices** create a dataset with a separate element for each row of the input tensor; can be used to combine different elements into one dataset, e.g., combine features and labels into one dataset. That is, the dataset becomes "wider".\n\n```\n>>> t = tf.constant([[1, 2], [3, 4]])\n>>> ds = tf.data.Dataset.from_tensor_slices(t)\n>>> [x for x in ds]\n    [<tf.Tensor: shape=(2,), dtype=int32, numpy=array([1, 2], dtype=int32)>,\n    <tf.Tensor: shape=(2,), dtype=int32, numpy=array([3, 4], dtype=int32)>]\n\n```',category:"Machine Learning",topic:"TensorFlow",level:0,uploader:"Mandeep singh"},B.e,t.M)
B.Mm=new A.r(7,{id:1675873575454,question:"How would you save an entire model in tensorflow.keras?  ",answer:"To save a model's architecture, weights, and training configuration in a single file/folder we can use two different file formats: SavedModel and HDF5.\n\n- **SavedModel**: Models saved in this format can be restored using tf.keras.models.load_model and are compatible with TensorFlow Serving.\n```\n# Create and train a new model instance.\nmodel = create_model()\nmodel.fit(train_images, train_labels, epochs=5)\n\n# Save the entire model as a SavedModel.\n!mkdir -p saved_model\nmodel.save('saved_model/my_model')\n```\nThe SavedModel format is a directory containing a protobuf binary and a TensorFlow checkpoint.\n\n- **HDF5 format**: it's a save format using the HDF5 standard.\n```\n  # Create and train a new model instance.\n  model = create_model()\n  model.fit(train_images, train_labels, epochs=5)\n\n  # Save the entire model to a HDF5 file.\n  model.save('my_model.h5')\n```",category:"Machine Learning",topic:"TensorFlow",level:0,uploader:"Mandeep singh"},B.e,t.M)
B.OM=new A.r(7,{id:1675664097939,question:"What is the difference between list and tuples in Python?",answer:"        \n\n **List**: \n- Lists are mutable i.e they can be edited.\t\n- Lists are slower than tuples.\t\n- Syntax: `` myList = [7, \u2018MSD\u2019, 183]\t ``\n\n\n **Tuples**: \n- Tuples are immutable (tuples are lists which can\u2019t be edited).\t\n- Tuples are faster than list.\n- Syntax: myTuple = (7, \u2018MSD\u2019, 183)\n\n\n\n    ",category:"Web Backend",topic:"Python",level:0,uploader:"Sacha Noam"},B.e,t.M)
B.Od=new A.r(7,{id:1675664178130,question:"What is slicing in Python?",answer:"Slicing is used to access parts of sequences like lists, tuples, and strings. The syntax of slicing is- ``[start:end:step]``. The step can be omitted as well. When we write ``[start:end]`` this returns all the elements of the sequence from the start (inclusive) till the end-1 element. If the start or end element is negative i, it means the ith element from the end. The step indicates the jump or how many elements have to be skipped. Eg. if there is a list- ``[1,2,3,4,5,6,7,8]``. Then ``[-1:2:2]`` will return elements starting from the last element till the third element by printing every second element.i.e. ``[8,6,4]``.",category:"Web Backend",topic:"Python",level:0,uploader:"Sacha Noam"},B.e,t.M)
B.My=new A.r(7,{id:1675664374613,question:"What are Decorators & Generators?",answer:"        \n\n**Decorators**\n- They are used to add some design patterns to a function without changing its structure. \n- Decorators generally are defined before the function they are enhancing. To apply a decorator we first define the decorator function. \n- Then we write the function it is applied to and simply add the decorator function above the function it has to be applied to. For this, we use the @ symbol before the decorator.\n\n**Generators**\n- Functions that return an iterable set of items are called generators.\n    ",category:"Web Backend",topic:"Python",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.Oh=new A.r(7,{id:1675664509413,question:"How is memory managed in Python?",answer:"Memory is managed in Python in the following ways:\n\n- Memory management in python is managed by **python private heap space**. All Python objects and data structures are located in a private heap. The programmer does not have access to this private heap. The python interpreter takes care of this instead.\n- The allocation of heap space for Python objects is done by Python\u2019s **memory manager**. The core API gives access to some tools for the programmer to code.\n- Python also has an inbuilt garbage collector, which recycles all the unused memory and so that it can be made available to the heap space.",category:"Web Backend",topic:"Python",level:1,uploader:"Rohan Patil"},B.e,t.M)
B.Oj=new A.r(7,{id:1675664675574,question:"What are Dict and List comprehensions?",answer:"Dictionary and list comprehensions are just another concise way to define dictionaries and lists.\n\nExample of list comprehension is-\n\n```\nx = [i for i in range(5)]\n```\nThe above code creates a list as below-\n```\n[0,1,2,3,4]\n```\n\nExample of dictionary comprehension is-\n\n```\nx = [i : i+2 for i in range(5)]\n```\nThe above code creates a list as below-\n```\n[0: 2, 1: 3, 2: 4, 3: 5, 4: 6]\n```\n",category:"Web Backend",topic:"Python",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.M8=new A.r(7,{id:1675664889007,question:"What is a typical workflow for implementing a new feature on the backend?  ",answer:"Workflows for implementing features on the backend can vary depending on the company and the technology stack. However, a typical workflow would involve discussing the feature with the stakeholders, designing and prototyping the feature, writing the code, and doing Quality Assurance (QA) testing. In most cases, the backend developer will work with the front-end developer to ensure that data is correctly transmitted between the client and server. It's also essential to ensure that any new features are backward compatible with previous versions of the application.",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Sandeep Jain"},B.e,t.M)
B.LG=new A.r(7,{id:1675664974401,question:"How would you select a cache strategy (e.g., LRU, FIFO)?",answer:"- Selecting a cache strategy depends on the application's specific needs. \n- For example, **LRU** (Least Recently Used) is a good choice for applications where frequently accessed data is also likely to be reaccessed. **FIFO** (First In, First Out) is a good choice for an application where data expires after a particular time.\n\n",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.OA=new A.r(7,{id:1675665041396,question:"What is the difference between promises and callbacks?",answer:"- **Promise** is an object that represents the result of an asynchronous operation. \n- **Callback** is a function that is invoked when an asynchronous operation completes.",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.LK=new A.r(7,{id:1675665168470,question:"What are the tradeoffs of client-side rendering vs. server-side rendering?",answer:"There are a few tradeoffs when deciding between client-side rendering and server-side rendering.\n\n- **Client-side** rendering can be more complex to set up because the application needs to be able to run in a browser. Meaning the code must be transpiled from a higher-level language (such as JavaScript) to a lower-level language (such as HTML). In addition, client-side rendering can be slower because the application needs to download all of the necessary resources before it can start rendering.\n\n- On the other hand, **Server-side** rendering is typically easier to set up because developers can use any language capable of generating HTML. In addition, server-side rendering can be faster because the HTML can be generated on the server and then sent to the client.",category:"Web Backend",topic:"Web Fundamentals",level:1,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.MP=new A.r(7,{id:1675665244118,question:"What is a microservice?",answer:"- **Microservice** is a small, independent component of a more extensive application. Each microservice has its own functionality and can be deployed independently.\n\n- Microservices often build into large, complex applications that are easy to maintain and scale. One of the benefits of using microservices is that they can be written in different programming languages and deployed on different servers.\n\n- Common examples of microservices include user authentication, payment processing, and image manipulation.\n\n",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.N8=new A.r(7,{id:1675665322198,question:"How would you implement authentication and authorization on a new project?",answer:"- There are many ways to implement authentication and authorization on a new project. One way would be to use an existing third-party service, such as Auth0 or Okta. Another way would be to roll out your solution using **JSON Web Tokens (JWTs)** or similar technology.\n\n- Regardless, you need to create a login page where users can enter their credentials. Once the user's credentials were verified, you would generate a JWT and send it back to the user. The user would then need to send the JWT with each authentication request.\n\n- You would also need to implement an authorization system to check if the user has the correct permissions to access a particular resource. One way to do this would be to create roles and assign users to those roles. Then, you would use that to check the user's permissions when handling each request.",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.LW=new A.r(7,{id:1675665407954,question:"What is the difference between a cookie and a session?",answer:"- A cookie is a small piece of data stored on the user's browser.\n- A session is a server-side data structure that holds information about the user's current session.\n\n- Cookies store information such as the user's ID, language preference, or any other preferences. \n- Sessions store information from a series of requests, such as the user's shopping cart or other information that needs to persist across multiple requests.",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Zulfikar Jusuf"},B.e,t.M)
B.M3=new A.r(7,{id:1675665495753,question:"How would you unit test a new feature?",answer:"1. When testing a new feature, you would first need to write a test covering the new feature's functionality. You should isolate these tests from any other code in the system. Once you write the test, you need to run it and verify that it passes.\n\n2. If the test fails, you need to debug the code and find the cause of the failure. Once you find the cause, you need to fix the code and re-run the test. If the test passes, you can then commit the code and move on to testing other features.",category:"Web Backend",topic:"Testing",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.ME=new A.r(7,{id:1675665581536,question:"Why are TDD tests written before code?",answer:"- **TDD (Test-Driven Development)** is a development methodology in which you write before code. \n- The idea behind TDD is that by writing tests first, developers can ensure that their code meets the requirements. In addition, TDD can help to find bugs early and prevent them from being introduced into the code.\n- However, TDD can be time-consuming and requires a good understanding of testing principles.",category:"Web Backend",topic:"Testing",level:1,uploader:"Rakesh Shah"},B.e,t.M)
B.NK=new A.r(7,{id:1675665632942,question:"How would you integrate tests into your workflow?",answer:"- When integrating tests into your workflow, you need to create a testing environment that mirrors the production environment as closely as possible. You need to set up this environment with all the necessary dependencies and data.\n\n- Once you have set up the testing environment, you need to write tests covering the system's functionality. These tests should be run automatically whenever new code gets pushed to the repository. If any of the tests fail, the build should be marked as failed, and the developers notified.\n\n- You should also manually run tests before each release. This will ensure that all of the functionality is working as expected and that there are no regressions.\n\n",category:"Web Backend",topic:"Testing",level:1,uploader:"Rakesh Shah"},B.e,t.M)
B.OJ=new A.r(7,{id:1675665753954,question:"How would you deploy a new version of an application?",answer:"There are many ways to deploy a new version of an application. One way would be to use a tool like **Ansible** or **Chef** to automate the process. Another way would be to run the necessary scripts on each server manually.\n\nIf you use a tool like Ansible or Chef, you need to update the configuration files and run the tool. This process deploys the new code to all of the servers in the environment.\n\nIf you deploy the code manually, you must log in to each server and run the necessary scripts. Doing this updates the code on each server individually.\n\nOnce the new code gets deployed, you need to run your tests to ensure everything is working as expected. If there are any issues, you must roll back the changes and fix the problem, then redeploy the code.\n\n",category:"Web Backend",topic:"Deployment",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.Mp=new A.r(7,{id:1675665826602,question:"How would you roll back a failed deployment?",answer:"- If a deployment fails, you must roll back the changes and fix the problem. \n- Once the problem is fixed, you can then redeploy the code.\n- To roll back a failed deployment, you need to undo any changes made during the deployment. \n- This process could include reverting code changes, restarting services, or rolling back database changes. Once the changes are back, you can redeploy the code.",category:"Web Backend",topic:"Deployment",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.NT=new A.r(7,{id:1675665980063,question:"What are NoSQL databases? What are the different types of NoSQL databases?",answer:"A **NoSQL** database provides a mechanism for storage and retrieval of data that is modeled in means other than the tabular relations used in relational databases (like SQL, Oracle, etc.).\n\nTypes of NoSQL databases:\n\n- Document Oriented\n- Key Value\n- Graph\n- Column Oriented\n",category:"Web Backend",topic:"Database",level:0,uploader:"Kiran Mahavir"},B.e,t.M)
B.MD=new A.r(7,{id:1675666086162,question:"What is SQL injection?",answer:"**Injection attacks** stem from a lack of strict separation between program instructions (i.e., code) and user-provided (or external) input. This allows an attacker to inject malicious code into a data snippet.\n\n**SQL injection** is one of the most common types of injection attack. To carry it out, an attacker provides malicious SQL statements through the application.\n\nHow to prevent:\n- Prepared statements with parameterized queries\n- Stored procedures\n- Input validation - blacklist validation and whitelist validation\n- Principle of least privilege - Application accounts shouldn\u2019t assign DBA or admin type access onto the database server. This ensures that if an application is compromised, an attacker won\u2019t have the rights to the database through the compromised application.\n",category:"Web Backend",topic:"Database",level:0,uploader:"Kiran Mahavir"},B.e,t.M)
B.NW=new A.r(7,{id:1675666160963,question:"Name some performance testing steps.",answer:"Some of the performance testing steps are:\n\n- Identify the testing environment\n- Identify performance metrics\n- Plan and design performance tests\n- Configure the test environment\n- Implement your test design\n- Execute tests\n- Analyze, report, retest\n",category:"Web Backend",topic:"Testing",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.Nf=new A.r(7,{id:1675666278250,question:"How to mitigate the SQL Injection risks?",answer:"To mitigate SQL injection:\n\n- **Prepared Statements with Parameterized Queries**: Always ensure that your SQL interpreter always able to differentiate between code and data. Never use dynamic queries which fail to find the difference between code and data. Instead, use static SQL query and then pass in the external input as a parameter to query.  Use of Prepared Statements (with Parameterized Queries) force developer to first define all the SQL code, and then pass in each parameter to the query later.\n- **Use of Stored Procedures**: Stored Procedure is like a function in C where database administrator call it whenever he/she need it. It is not completely mitigated SQL injection but definitely helps in reducing risks of SQL injection by avoiding dynamic SQL generation inside.\n- **White List Input Validation**: Always use white list input validation and allow only preapproved input by the developer. Never use blacklist approach as it is less secure than whitelist approach.\n- **Escaping All User Supplied Input**\n- **Enforcing Least Privilege**\n",category:"Web Backend",topic:"Database",level:1,uploader:"Rakesh Shah"},B.e,t.M)
B.Mr=new A.r(7,{id:1675666338102,question:"What is the difference between Acceptance Test and Functional Test?",answer:"- **Functional testing**: This is a verification activity; did we build a correctly working product? Does the software meet the business requirements? A functional test verifies that the product actually works as you (the developer) think it does.\n\n- **Acceptance testing**: This is a validation activity; did we build the right thing? Is this what the customer really needs? Acceptance tests verify the product actually solves the problem it was made to solve. This can best be done by the user (customer), for instance performing his/her tasks that the software assists with.\n\n",category:"Web Backend",topic:"Testing",level:1,uploader:"Kiran Mahavir"},B.e,t.M)
B.Nj=new A.r(7,{id:1675666443592,question:"What Is ACID Property Of A System?",answer:"**ACID** is a acronym which is commonly used to define the properties of a relational database system, it stand for following terms\n\n- **_Atomicity_** - This property guarantees that if one part of the transaction fails, the entire transaction will fail, and the database state will be left unchanged.\n- **_Consistency_** - This property ensures that any transaction will bring the database from one valid state to another.\n- **_Isolation_** - This property ensures that the concurrent execution of transactions results in a system state that would be obtained if transactions were executed serially.\n- _**Durable**_ - means that once a transaction has been committed, it will remain so, even in the event of power loss.\n",category:"Web Backend",topic:"Database",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.Op=new A.r(7,{id:1675666544952,question:'What Is Sticky Session Load Balancing? What Do You Mean By "Session Affinity"?',answer:"_Sticky session or a session affinity_ technique is another popular load balancing technique that requires a user session to be always served by an allocated machine.\n\nIn a load balanced server application where user information is stored in session it will be required to keep the session data available to all machines. This can be avoided by always serving a particular user session request from one machine. The machine is associated with a session as soon as the session is created. All the requests in a particular session are always redirected to the associated machine. This ensures the user data is only at one machine and load is also shared.\n\nThis is typically done by using SessionId cookie. The cookie is sent to the client for the first request and every subsequent request by client must be containing that same cookie to identify the session.",category:"Web Backend",topic:"Web Fundamentals",level:1,uploader:""},B.e,t.M)
B.Oi=new A.r(7,{id:1675666615633,question:"What Are The Issues With Sticky Session?",answer:"There are few issues that you may face with this approach\n\n\n- The client browser may not support cookies, and your load balancer will not be able to identify if a request belongs to a session. This may cause strange behavior for the users who use no cookie based browsers.\n- In case one of the machine fails or goes down, the user information (served by that machine) will be lost and there will be no way to recover user session.\n",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.ON=new A.r(7,{id:1675666669242,question:"What are disadvantages of REST web services?",answer:"Some of the disadvantages of REST are:\n\n- Since there is no contract defined between service and client, it has to be communicated through other means such as documentation or emails.\n- Since it works on HTTP, there can\u2019t be asynchronous calls.\nSessions can\u2019t be maintained.\n",category:"Web Backend",topic:"Web Fundamentals",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.OP=new A.r(7,{id:1675666765976,question:"What is the difference between JOIN and UNION?",answer:"**UNION** puts lines from queries after each other, while **JOIN** makes a cartesian product and subsets it -- completely different operations. Trivial example of UNION:\n```\nmysql> SELECT 23 AS bah\n    -> UNION\n    -> SELECT 45 AS bah;\n+-----+\n| bah |\n+-----+\n|  23 |\n|  45 |\n+-----+\n2 rows in set (0.00 sec)\n```\n\nsimilary trivial example of JOIN:\n\n```\nmysql> SELECT * FROM\n    -> (SELECT 23 AS bah) AS foo\n    -> JOIN\n    -> (SELECT 45 AS bah) AS bar\n    -> ON (33=33);\n+-----+-----+\n| foo | bar |\n+-----+-----+\n|  23 |  45 |\n+-----+-----+\n1 row in set (0.01 sec)\n```",category:"Web Backend",topic:"Database",level:0,uploader:"Rakesh Shah"},B.e,t.M)
B.O4=new A.r(7,{id:1675666868165,question:"What are the differences between Continuous Integration, Continuous Delivery, and Continuous Deployment?",answer:"- Developers practicing **Continuous integration** merge their changes back to the main branch as often as possible. By doing so, you avoid the integration hell that usually happens when people wait for release day to merge their changes into the release branch.\n- **Continuous delivery** is an extension of continuous integration to make sure that you can release new changes to your customers quickly in a sustainable way. This means that on top of having automated your testing, you also have automated your release process and you can deploy your application at any point of time by clicking on a button.\n- **Continuous deployment** goes one step further than continuous delivery. With this practice, every change that passes all stages of your production pipeline is released to your customers. There's no human intervention, and only a failed test will prevent a new change to be deployed to production.",category:"Web Backend",topic:"Deployment",level:1,uploader:"Rakesh Shah"},B.e,t.M)
B.NH=new A.r(7,{id:1675667141770,question:"What Is CAP Theorem?",answer:"The **CAP Theorem** for distributed computing was published by Eric Brewer. This states that it is not possible for a distributed computer system to simultaneously provide all three of the following guarantees:\n\n- Consistency (all nodes see the same data even at the same time with concurrent updates )\n- Availability (a guarantee that every request receives a response about whether it was successful or failed)\n- Partition tolerance (the system continues to operate despite arbitrary message loss or failure of part of the system)\n\nThe CAP acronym corresponds to these three guarantees. This theorem has created the base for modern distributed computing approaches. Worlds most high volume traffic companies (e.g. Amazon, Google, Facebook) use this as basis for deciding their application architecture. It's important to understand that only two of these three conditions can be guaranteed to be met by a system.",category:"Web Backend",topic:"Distributed Computing",level:0,uploader:"Imtiaz Naseem"},B.e,t.M)
B.M2=new A.r(7,{id:1675667555704,question:"Differentiate between div and span?",answer:"        \n**DIV**\n- It is utilized for separating the elements that are block-line, line break before and after it.\n- It contains global attributes for the certain element in HTML documents.\n- At times para tag <P> is utilised for inner side of the <div> tag.\t\n- In div tag, we make use of borders with width height with specified color pixels to emphasize the front end document.\t\n\n**SPAN**\n- Span is utilized for grouping inline elements in the HTML doc.\n- It includes certain, global and event attributes.\n- In a paragraph, <span> tag is utilized to use a CSS style for certain words with the selected font sets.\n- In the Span tag, we utilize specified color coding to depict the front-end document. \n\n\n\n    ",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Imtiaz Naseem"},B.e,t.M)
B.LY=new A.r(7,{id:1675667710796,question:"What is a Grid system in CSS?",answer:"CSS splits the page into grids and utilizes those grids to handle the HTML content. Utilizing the Grids, CSS can stack and highlight various elements in different parts of the grids.\n\n[W3 Schools Doc](https://www.w3schools.com/css/css_grid.asp)",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Imtiaz Naseem"},B.e,t.M)
B.Nv=new A.r(7,{id:1675667843607,question:"What is HTML DOM?",answer:"- The **Document Object Model** (DOM) represents the structure of a document with which the web pages can be connected to programming languages or scripts. \n- The document is represented with a logical tree. Each branch of the tree ends in a node and each node contains objects. \n- The structure, style, or content of the document can also be changed. The nodes can have event handlers attached to them that can respond to events. \n\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Jeffery Preston"},B.e,t.M)
B.MR=new A.r(7,{id:1675668072337,question:"How browsers render the UI?",answer:"The primary responsibility of the rendering engine is to highlight the requested page on the browser\u2019s screen. Rendering engines can show XML and HTML images and documents. If you\u2019re utilising additional plugins, the engines can also exhibit various documents like PDF.\n\n- **Receives the requested document**: The contents of the requested document is obtained by the rendering engine from HTML\u2019s networking layer.\n- **Construct the DOM tree**: Parsed the HTML to the parsed tree and then set up the DOM tree, making use of it.\n- **Construct the CSSOM**: CSSOM stands for CSS Object Model. Post the construction of the DOM tree, it identifies a link tag in the head section, which references the external style.css CSS style sheet. So, it parsed the CSS file in CSSOM tree, something which the Browser can comprehend as the DOM tree.\n- **Construct the Render tree**: Utilise the HTML DOM tree coupled with the styling data of the CSSOM tree to set up a render tree. Render tree is the graphical depiction of the HTML, with the corresponding CSS. This tree enables painting the contents in their right order. Every node in the Render Tree is regarded as a renderer. The Render tree looks like this:\n- **Layout**: When the renderer is developed and incorporated into the tree, it does not have a size or position. Computing these values is defined as layout. We use the coordinates system to position the element, such as the position of the root renderer is 0,0. The layout continues recursively via a part of the entire renderer hierarchy, calculating geometric info for every renderer that needs it. Beginning the layout process _implies allowing every node the exact coordinates where it should show up on the screen._\n- **Painting of the Render Tree**: The renderer tree is traversed in this stage and the renderer\u2019s paint() method is hailed to exhibit the content on the screen. For good UX, the rendering engine will aim to exhibit the contents on the screen as soon as possible. It will not stand by until all the HTML is parsed to develop and layout the render tree.\n",category:"Web Frontend",topic:"Web Basics",level:1,uploader:""},B.e,t.M)
