B.Ne=new A.r(7,{id:1675874105069,question:"Explain all components of a Hadoop application.",answer:"- **Hadoop Common**: It is a common set of utilities and libraries that are utilized by Hadoop.\n- **HDFS**: This Hadoop application relates to the file system in which the Hadoop data is stored. It is a distributed file system having high bandwidth.\n- **Hadoop MapReduce**: It is based according to the algorithm for the provision of large-scale data processing.\n- **Hadoop YARN**: It is used for resource management within the Hadoop cluster. It can also be used for task scheduling for users.\n\n![hadoop](https://i.postimg.cc/P5QS6xdw/Hadoonh-3-640x398.png)",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.MT=new A.r(7,{id:1675874226928,question:"Do you have any experience in building data systems using the Hadoop framework?",answer:"- If you have experience with Hadoop, state your answer with a detailed explanation of the work you did to focus on your skills and tool's expertise. You can explain all the essential features of Hadoop\n- . For example, you can tell them you utilized the Hadoop framework because of its scalability and ability to increase the data processing speed while preserving the quality.\n\nSome features of Hadoop include: \n\n- It is Java-Based. Hence, there may be no additional training required for team members. Also, it is easy to use. \n- As the data is stored within Hadoop, it is accessible in the case of hardware failure from other paths, which makes it the best choice for handling big data. \n- In Hadoop, data is stored in a cluster, making it independent of all the other operations.\n\n> **Tip**: In case you have no experience with this tool, learn the necessary information about the tool's properties and attributes.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.Nm=new A.r(7,{id:1675874288433,question:"What is NameNode? What happens if NameNode crashes or comes to an end?\n",answer:"- It is the centre-piece or central node of the Hadoop Distributed File System(HDFS), and it does not store actual data. It stores metadata.\n-  For example, the data being stored in DataNodes on which rack and which DataNode the information is stored. \n- It tracks the different files present in clusters. Generally, there is one NameNode, so when it crashes, the system may not be available.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.Nh=new A.r(7,{id:1675874759426,question:"Can you elaborate on Reducer in Hadoop MapReduce? Explain the core methods of Reducer?",answer:"**Reducer** is the second stage of data processing in the Hadoop Framework. The Reducer processes the data output of the mapper and produces a final output that is stored in HDFS. \n\nThe Reducer has 3 phases:\n\n- **Shuffle**: The output from the mappers is shuffled and acts as the input for Reducer.\n- **Sorting** is done simultaneously with shuffling, and the output from different mappers is sorted. \n\n- **Reduce**: in this step, Reduces aggregates the key-value pair and gives the required output, which is stored on HDFS and is not further sorted.\n\n\nThere are three core methods in Reducer:\n\n- **Setup** : it configures various parameters like input data size.\n- **Reduce** : It is the main operation of Reducer. In this method, a task is defined for the associated key.\n- **Cleanup**: This method cleans temporary files at the end of the task.\n",category:"Data Engineer",topic:"Hadoop",level:1,uploader:"Narayana Kailash"},B.e,t.M)
B.Mz=new A.r(7,{id:1675874843330,question:"How can you deploy a big data solution?",answer:"The steps involved are:\n\n- **Data Integration/Ingestion**: In this step, the extraction of data using data sources like RDBMS, Salesforce, SAP, MySQL is done.\n- **Data storage**: The extracted data would be stored in an HDFS or NoSQL database.\n- **Data processing**: the last step should be deploying the solution using processing frameworks like MapReduce, Pig, and Spark.\n",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.OS=new A.r(7,{id:1675874929243,question:"What are the steps that occur when Block Scanner detects a corrupted data block?",answer:"Following are the steps that occur when Block Scanner find a corrupted data block:\n\n1) First of all, when Block Scanner find a corrupted data block, DataNode report to NameNode\n\n2) NameNode start the process of creating a new replica using a replica of the corrupted block.\n\n3) Replication count of the correct replicas tries to match with the replication factor. If the match found corrupted data block will not be deleted.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.Oa=new A.r(7,{id:1675874999944,question:"What are four V\u2019s of big data?",answer:"The four V\u2019s of big data are:\n\n- **Velocity**\n- **Variety**\n- **Volume**\n- **Veracity**",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.MU=new A.r(7,{id:1675875084441,question:"Explain the use of Hive in Hadoop eco-system.",answer:"- Hive provides an interface to manage data stored in Hadoop eco-system. \n- Hive is used for mapping and working with HBase tables.\n-  Hive queries are converted into MapReduce jobs in order to hide the complexity associated with creating and running MapReduce jobs.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.O6=new A.r(7,{id:1675875125323,question:"Explain how .hiverc file in Hive is used.",answer:"- In Hive, .hiverc is the initialization file.\n- This file is initially loaded when we start Command Line Interface (CLI) for Hive. \n- We can set the initial values of parameters in .hiverc file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.LO=new A.r(7,{id:1675875222365,question:"What is COSHH?",answer:"**Classification and Optimization-based Scheduling for Heterogeneous Hadoop Systems**(COSHH), as the name implies, enables scheduling at both the cluster and application levels to have a direct positive impact on task completion time.\n\n",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.Nn=new A.r(7,{id:1675875316968,question:"What are Skewed tables in Hive?",answer:"- Skewed tables are a type of table in which some values in a column appear more frequently than others.\n- The distribution is skewed as a result of this. \n- When a table is created in Hive with the SKEWED option, the skewed values are written to separate files, while the remaining data are written to another file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.Nd=new A.r(7,{id:1677252383256,question:"What do you know about Big O notation?  ",answer:'        \n- Big-O notation also called as "asymptotic growth" notation is a relative representation of the complexity of an algorithm. \n- It shows how an algorithm scales based on input size. We use it to talk about how thing scale.\n - Big O complexity can be visualized with this graph-\n\n![BigO](https://i.postimg.cc/j5SGCg3Q/WcBRI.png)\n\n\n    ',category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.N2=new A.r(7,{id:1677252474601,question:"Why there was a need to use Big O notation to compare algorithms?",answer:"        \n- The fact is it's difficult to determine the exact runtime of an algorithm. \n- It depends on the speed of the computer processor. So instead of talking about the runtime directly, we use Big O Notation to talk about how quickly the runtime grows depending on input size.\n\n- With Big O Notation, we use the size of the input, which we call n. So we can say things like the runtime grows \u201con the order of the size of the input\u201d (O(n)) or \u201con the order of the square of the size of the input\u201d (O(n2)).\n- Our algorithm may have steps that seem expensive when n is small but are eclipsed eventually by other steps as n gets larger. \n- For Big O Notation analysis, we care more about the stuff that grows fastest as the input grows, because everything else is quickly eclipsed as n gets very large.\n\n\n    ",category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Mi=new A.r(7,{id:1677252804250,question:"Explain the difference between O(1) vs O(n) space complexities.",answer:"        \n- Let's consider a traversal algorithm for traversing a list.\n\n- O(1) denotes constant space use: the algorithm allocates the same number of pointers irrespective to the list size. \n- That will happen if we move (reuse) our pointer along the list.\nIn contrast, O(n) denotes linear space use: the algorithm space use grows together with respect to the input size n. \n- That will happen if let's say for some reason the algorithm needs to allocate 'N' pointers (or other variables) when traversing a list.\n\n    ",category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NP=new A.r(7,{id:1677252953594,question:"Why is text preprocessing done in NLP?",answer:"        \n- Text preprocessing is done to transform a text into a more digestible form so that the machine learning algorithms can perform better.\n- It is found that in tasks such as sentiment analysis, performing some preprocessing such as removing stop-words helps improve the accuracy of the machine learning model.\n\n- Some common text preprocessing done are:\n1. removing HTML tags\n2. removing stop-words\n3. removing numbers\n4. lower casing all letters\n5. Lemmatization\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MQ=new A.r(7,{id:1677253054658,question:"What is the difference between Lemmatisation and Stemming? ",answer:"        \nStemming just removes the last few characters of a word, often leading to incorrect meanings and spellings.\n\nConsider:\n\n```\neating -> eat, Caring -> Car.\n```\nLemmatization considers the context and converts the word to its meaningful base form, which is called Lemma.\n\nConsider:\n```\nStripes -> Strip (verb) -or- Stripe (noun), better -> good\n```\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Nt=new A.r(7,{id:1677253107882,question:"What is the use of PoS (Part of Speech) tagging?  ",answer:"        \n- PoS tagging is used to classify each word into its part of speech.\n- Parts of speech can be used to find grammatical, or lexical patterns without specifying the word used.\n- In English especially, the same word can be different parts of speech, so hence, PoS tagging can be helpful to differentiate between them.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.M4=new A.r(7,{id:1677253158327,question:"What are some of the advantages of using the Bag-of-Words to extract features?",answer:"        \n- It identifies the occurrence of words in a document. It identifies the vocabulary and the presence of known words. Hence, it is very simple and flexible.\n- It is intuitive that documents consisting of similar content will be similar in other ways such as meaning too. So, the BoW process will create a simple and quick group of features that can be used.\n- The BoW model can be made as simple, and as complicated as possible. The main difference is how the vocabulary of words is maintained, and how the different words are scored.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.N5=new A.r(7,{id:1677253444921,question:"What is a One-Hot Vector? How can they be used in Natural Language Processing?  ",answer:'        \n- A one-hot is a group of bits which only has one high 1 bit and all other bits are low 0.\n- In Natural Language Processing, the one-hot vector can be used to represent a sentence in the form of a matrix of 1 x N size where N is the number of individual words in the corpus.\n- For example, the sentence "Peter picked a piece of pickled pepper" can be transformed into a matrix of 1 x 7 where each word is represented by the 7 columns. Hence the output of the sentence is: [0000001, 0000010, 0000100, 0001000, 0010000, 0100000, 1000000]\n- An understandable representation of a one-hot vector is shown by the diagram below:\n\n![enter image description here](https://miro.medium.com/max/1225/0*QMGjp-fPYpPaE3eK)\n\n\n    ',category:"Machine Learning",topic:"NLP",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Og=new A.r(7,{id:1677253521018,question:"What are the different types of text Preprocessing?  ",answer:"        \nSteps of text preprocessing can be divided into 3 major types:\n\n- **Tokenization**: It is a process where a group of texts are divided into smaller pieces, or tokens. Paragraphs are tokenized into sentences, and sentences are tokenized into words.\n- **Normalization**: Database normalization is where the structure of the database is converted to a series of normal forms. What it achieves is the organization of the data to appear similar across all records and fields. Similarly, in the field of NLP, normalization can be the process of converting all the words to its lowercase. This makes all the sentences and tokens appear the same and does not complicate the machine learning algorithm.\n- **Noise Removal**: It is a process of cleaning up the text. Doing things such as removing characters which are not required, such as white spaces, numbers, special characters, etc.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.LU=new A.r(7,{id:1677253694082,question:"How do you choose the optimal k in k-NN?",answer:"        \nThere is not a rule of thumb to choose a standard optimal k. This value depends and varies from dataset to dataset, but as a general rule, the main goal is to keep it:\n\n- small enough to exclude the samples of the other classes but\n- large enough to minimize any noise in the data.\n\nA way to looking for this optimal parameter, commonly called the Elbow method, consist in creating a for loop that trains various KNN models with different k values, keeping track of the error for each of these models, and use the model with the k value that achieves the best accuracy.\n\n![knn](https://i.postimg.cc/kD3gK6Hc/ct2ie.jpg)\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Ny=new A.r(7,{id:1677253857709,question:"What's the difference between k-Nearest Neighbors and Radius Nearest Neighbors?",answer:"        \n**KNN**\n- The k-neighbors classification is a very commonly used technique and is widely applied in various scenarios.\nKNN implements learning based on the k nearest neighbors of each query point, where k is a hyperparameter of an integer value.\n- The optimal choice of the value k is highly data-dependent: in general, a larger k suppresses the effects of noise but makes the classification boundaries less distinct.\n\n**RNN**\n- The r-neighbors classification is used in cases where the data is not uniformly sampled or is sparse.\n- RNN implements learning based on the number of neighbors within a fixed radius r of each training point, where r is a hyperparameter of the type float.\n- The optimal fixed radius r is chosen such that points in sparser neighborhoods use fewer nearest neighbors for the classification.\n\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.LR=new A.r(7,{id:1677254076369,question:"What is the main difference between k-Means and k-Nearest Neighbours?",answer:"        \n- **K-Means** is a clustering algorithm that tries to partition a set of points into k sets such that the points in each cluster tend to be near each other. It is unsupervised because the points have no external classification.\n\n![enter image description here](https://i.postimg.cc/RCfd5rRr/68747470733a2f2f7364732d706c6174666f726d2d707269766174652e73332d75732d656173742d322e616d617a6f6e6177.png)\n\n- **K-Nearest Neighbors** is a classification (or regression) algorithm that, in order to determine the classification of a point, combines the classification of the k nearest points. It is supervised because it is trying to classify a point based on the known classification of other points.\n\n![enter image description here](https://raw.githubusercontent.com/artifabrian/dynamic-knn-gpu/master/knn.png)\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.MN=new A.r(7,{id:1677254212378,question:"What is k-Nearest Neighbors algorithm?",answer:"        \n- **K-Nearest Neighbors** is a supervised machine learning algorithm that can be used to solve both classification and regression problems.\nIt assumes that similar things are closer to each other in certain feature spaces, in other words, similar things are in close proximity.\n\n![enter image description here](https://miro.medium.com/max/917/1*wW8O-0xVQUFhBGexx2B6hg.png)\n\n\n- The image above shows how similar points are closer to each other. KNN hinges on this assumption being true enough for the algorithm to be useful.\n- There are many different ways of calculating the distance between the points, however, the straight line distance (Euclidean distance) is a popular and familiar choice.\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.N6=new A.r(7,{id:1677331378952,question:"What is JVM ? Why is Java called the Platform Independent Programming Language?",answer:" \n- A Java virtual machine (JVM) is a process **virtual machine** that can execute Java **bytecode**. \n- Each Java source file is compiled\ninto a bytecode file, which is executed by the JVM. Java was designed to allow application programs to be built that could be\nrun on any platform, without having to be rewritten or recompiled by the programmer for each separate platform. \n- A Java virtual machine makes this possible, because it is aware of the specific instruction lengths and other particularities of the underlying\nhardware platform.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.On=new A.r(7,{id:1677331470463,question:"What is the Difference between JDK and JRE ?",answer:" - The **Java Runtime Environment** (JRE) is basically the Java Virtual Machine (JVM) where your Java programs are being executed.\n- It also includes browser plugins for applet execution. \n- The **Java Development Kit** (JDK) is the full featured Software Development\nKit for Java, including the JRE, the compilers and tools (like _JavaDoc_, and _Java Debugger_), in order for a user to develop, compile\nand execute Java applications.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.O8=new A.r(7,{id:1677331573726,question:"What does the \u201cstatic\u201d keyword mean ? Can you override private or static method in Java ?",answer:"- The **static** keyword denotes that a member variable or method can be accessed, without requiring an instantiation of the class to\nwhich it belongs.\n- A user cannot override static methods in Java, because method overriding is based upon dynamic binding at\nruntime and static methods are statically binded at compile time. \n- A static method is not associated with any instance of a class\nso the concept is not applicable.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LP=new A.r(7,{id:1677331630491,question:"Can you access non static variable in static context?",answer:"- A static variable in Java belongs to its class and its value remains the same for all its instances.\n- A static variable is initialized\nwhen the class is loaded by the JVM. If your code tries to access a non-static variable, without any instance, the compiler will\ncomplain, because those variables are not created yet and they are not associated with any instance.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LZ=new A.r(7,{id:1677331727860,question:"What are the Data Types supported by Java ? What is Autoboxing and Unboxing?",answer:"The eight primitive data types supported by the Java programming language are:\n\n\u2022 byte\n\n\u2022 short\n\n\u2022 int\n\n\u2022 long\n\n\u2022 float\n\n\u2022 double\n\n\u2022 boolean\n\n\u2022 char\n\n **Autoboxing** is the automatic conversion made by the Java compiler between the primitive types and their corresponding object\nwrapper classes. For example, the compiler converts an int to an Integer, a double to a Double, and so on. If the conversion goes\nthe other way, this operation is called **Unboxing**.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Md=new A.r(7,{id:1677331796472,question:"What is Function Overriding and Overloading in Java?",answer:"- **Method overloading** in Java occurs when two or more methods in the same class have the exact same name, but different\nparameters. On the other hand, method overriding is defined as the case when a child class redefines the same method as a parent\nclass. \n- **Overridden methods** must have the same name, argument list, and return type. The overriding method may not limit the\naccess of the method it overrides.\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.N0=new A.r(7,{id:1677332462430,question:"What is a Constructor, Constructor Overloading in Java and Copy-Constructor?",answer:"        \n- A constructor gets invoked when a new object is created. Every class has a constructor. In case the programmer does not provide\na constructor for a class, the Java compiler (Javac) creates a default constructor for that class. \n- The constructor overloading is\nsimilar to method overloading in Java. Different constructors can be created for a single class. \n- Each constructor must have its\nown unique parameter list. Finally, Java does support copy constructors like C++, but the difference lies in the fact that Java\ndoesn\u2019t create a default copy constructor if you don\u2019t write your own.\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NE=new A.r(7,{id:1677332577527,question:"Does Java support multiple inheritance?",answer:"\n- No, Java does not support multiple inheritance.\n- Each class is able to extend only on one class, but is able to implement more than\none interfaces.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mg=new A.r(7,{id:1677332677692,question:"What is the difference between an Interface and an Abstract class?",answer:"        \nJava provides and supports the creation both of **abstract classes** and **interfaces**. Both implementations share some common\ncharacteristics, but they differ in the following features:\n\n\u2022 All methods in an interface are implicitly abstract. On the other hand, an abstract class may contain both abstract and nonabstract methods.\n\n\u2022 A class may implement a number of Interfaces, but can extend only one abstract class.\n\n\u2022 In order for a class to implement an interface, it must implement all its declared methods. However, a class may not implement\nall declared methods of an abstract class. Though, in this case, the sub-class must also be declared as abstract.\n\n\u2022 Abstract classes can implement interfaces without even providing the implementation of interface methods.\n\n\u2022 Variables declared in a Java interface is by default final. An abstract class may contain non-final variables.\n\n\u2022 Members of a Java interface are public by default. A member of an abstract class can either be private, protected or public.\n\n\u2022 An interface is absolutely abstract and cannot be instantiated. An abstract class also cannot be instantiated, but can be invoked\nif it contains a main method.\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NI=new A.r(7,{id:1677332799006,question:"What is the difference between processes and threads?",answer:"- A process is an execution of a program, while a Thread is a single execution sequence within a process. \n- A process can contain multiple threads.\n- A Thread is sometimes called a lightweight process.\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Oe=new A.r(7,{id:1677333836498,question:"Explain different ways of creating a thread. Which one would you prefer and why?",answer:"There are three ways that can be used in order for a Thread to be created:\n\n\u2022 A class may extend the Thread class.\n\n\u2022 A class may implement the Runnable interface.\n\n\u2022 An application can use the Executor framework, in order to create a thread pool.\n\nThe **Runnable** interface is preferred, as it does not require an object to inherit the Thread class. In case your application design\nrequires multiple in\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mw=new A.r(7,{id:1677334188616,question:" Explain the available thread states in a high-level.",answer:"        \nDuring its execution, a thread can reside in one of the following states:\n\n\u2022 **Runnable**: A thread becomes ready to run, but does not necessarily start running immediately.\n\n\u2022 **Running**: The processor is actively executing the thread code.\n\n\u2022 **Waiting**: A thread is in a blocked state waiting for some external processing to finish.\n\n\u2022 **Sleeping**: The thread is forced to sleep.\n\n\u2022 **Blocked on I/O**: Waiting for an I/O operation to complete.\n\n\u2022 **Blocked on Synchronization**: Waiting to acquire a lock.\n\n\u2022 **Dead**: The thread has finished its execution.\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OF=new A.r(7,{id:1677334504810,question:"What is the difference between a synchronized method and a synchronized block?",answer:"- In Java programming, each object has a lock. A thread can acquire the lock for an object by using the synchronized keyword.\n- The synchronized keyword can be applied in a method level (coarse grained lock) or block level of code (fine grained lock).\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nx=new A.r(7,{id:1677334708349,question:"What are the basic interfaces of Java Collections Framework?",answer:"\n**Java Collections Framework** provides a well designed set of interfaces and classes that support operations on a collections of\nobjects. \n\nThe most basic interfaces that reside in the Java Collections Framework are:\n\n\u2022 **Collection**: which represents a group of objects known as its elements.\n\n\u2022 **Set**: which is a collection that cannot contain duplicate elements.\n\n\u2022 **List**: which is an ordered collection and can contain duplicate elements.\n\n\u2022 **Map**: which is an object that maps keys to values and cannot contain duplicate keys\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LQ=new A.r(7,{id:1677334939822,question:"Why Collection doesn\u2019t extend Cloneable and Serializable interfaces?",answer:"- The Collection interface specifies groups of objects known as elements. \n- Each concrete implementation of a Collection can choose\nits own way of how to maintain and order its elements. \n- Some collections allow duplicate keys, while some other collections don\u2019t.\nThe semantics and the implications of either cloning or serialization come into play when dealing with actual implementations.\n- Thus, the concrete implementations of collections should decide how they can be cloned or serialized.\n    ",category:"Java",topic:"Collections",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nk=new A.r(7,{id:1677335270583,question:"What differences exist between Iterator and ListIterator?",answer:"The differences of these elements are listed below:\n\n\u2022 An Iterator can be used to traverse the Set and List collections, while the ListIterator can be used to iterate only over Lists.\n\n\u2022 The Iterator can traverse a collection only in forward direction, while the ListIterator can traverse a List in both directions.\n\n\u2022 The ListIterator implements the Iterator interface and contains extra functionality, such as adding an element, replacing an\nelement, getting the index position for previous and next elements, etc.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NB=new A.r(7,{id:1677335435778,question:"How HashMap works in Java?",answer:" - A HashMap in Java stores key-value pairs. \n- The HashMap requires a hash function and uses hashCode and equals methods,\nin order to put and retrieve elements to and from the collection respectively. \n- When the put method is invoked, the HashMap\ncalculates the hash value of the key and stores the pair in the appropriate index inside the collection. \n- If the key exists, its value\nis updated with the new value. \n- Some important characteristics of a HashMap are its capacity, its load factor and the thresholdresizing.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MF=new A.r(7,{id:1677335518321,question:"What is the importance of hashCode() and equals() methods?",answer:"- In Java, a **HashMap** uses the hashCode and equals methods to determine the index of the key-value pair and to detect duplicates.\n- More specifically, the hashCode method is used in order to determine where the specified key will be stored. \n- Since different keys\nmay produce the same hash value, the equals method is used, in order to determine whether the specified key actually exists in\nthe collection or not. \n- Therefore, the implementation of both methods is crucial to the accuracy and efficiency of the HashMap.\n\n\n    ",category:"Java",topic:"Collections",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MC=new A.r(7,{id:1677335638325,question:"What differences exist between HashMap and Hashtable?",answer:" Both the HashMap and Hashtable classes implement the Map interface and thus, have very similar characteristics. However, they\ndiffer in the following features:\n\n\u2022 A HashMap allows the existence of null keys and values, while a Hashtable doesn\u2019t allow neither null keys, nor null values.\n\n\u2022 A Hashtable is synchronized, while a HashMap is not. Thus, HashMap is preferred in single-threaded environments, while a\nHashtable is suitable for multi-threaded environments.\n\n\u2022 A HashMap provides its set of keys and a Java application can iterate over them. Thus, a HashMap is fail-fast. On the other\nhand, a Hashtable provides an Enumeration of its keys.\n\n\u2022 The Hashtable class is considered to be a legacy class\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nz=new A.r(7,{id:1677335716741,question:"What is difference between Array and ArrayList ? When will you use Array over ArrayList?",answer:"The Array and ArrayList classes differ on the following features:\n\n\u2022 Arrays can contain primitive or objects, while an ArrayList can contain only objects.\n\n\u2022 Arrays have fixed size, while an ArrayList is dynamic.\n\n\u2022 An ArrayList provides more methods and features, such as addAll, removeAll, iterator, etc.\n\n\u2022 For a list of primitive data types, the collections use autoboxing to reduce the coding effort. However, this approach makes\nthem slower when working on fixed size primitive data types.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LN=new A.r(7,{id:1677335813905,question:"What is difference between ArrayList and LinkedList?",answer:"Both the **ArrayList** and **LinkedList** classes implement the List interface, but they differ on the following features:\n\n\u2022 An ArrayList is an index based data structure backed by an Array. It provides random access to its elements with a performance\nequal to O(1). On the other hand, a LinkedList stores its data as list of elements and every element is linked to its previous and\nnext element. In this case, the search operation for an element has execution time equal to O(n).\n\n\u2022 The Insertion, addition and removal operations of an element are faster in a LinkedList compared to an ArrayList, because\nthere is no need of resizing an array or updating the index when an element is added in some arbitrary position inside the\ncollection.\n\n\u2022 A LinkedList consumes more memory than an ArrayList, because every node in a LinkedList stores two references, one for its\nprevious element and one for its next element\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.O2=new A.r(7,{id:1677335904121,question:"What do you know about the big-O notation and can you give some examples with respect to different data structures ?",answer:"- The **Big-O notation** simply describes how well an algorithm scales or performs in the worst case scenario as the number of elements in a data structure increases. \n- The Big-O notation can also be used to describe other behavior such as memory consumption.\n- Since the collection classes are actually data structures, we usually use the Big-O notation to chose the best implementation to\nuse, based on time, memory and performance. \n- Big-O notation can give a good indication about performance for large amounts\nof data.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.M_=new A.r(7,{id:1677336011303,question:"What is the tradeoff between using an unordered array versus an ordered array?",answer:"- The major advantage of an ordered array is that the search times have time complexity of O(log n), compared to that of an\nunordered array, which is O (n). \n- The disadvantage of an ordered array is that the insertion operation has a time complexity of\nO(n), because the elements with higher values must be moved to make room for the new element. \n- Instead, the insertion operation for an unordered array takes constant time of O(1).\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NV=new A.r(7,{id:1677336086785,question:"What is the difference between HashSet and TreeSet?",answer:"- The HashSet is Implemented using a hash table and thus, its elements are not ordered. \n- The add, remove, and contains methods of\na HashSet have constant time complexity O(1). \n- On the other hand, a TreeSet is implemented using a tree structure. \n- The elements\nin a TreeSet are sorted, and thus, the add, remove, and contains methods have time complexity of O(logn).\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mo=new A.r(7,{id:1677343275162,question:"What is the purpose of garbage collection in Java, and when is it used?",answer:"The purpose of garbage collection is to **identify** and **discard** those objects that are no longer needed by the application, in order\nfor the resources to be reclaimed and reused.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mb=new A.r(7,{id:1677343331892,question:"What does System.gc() and Runtime.gc() methods do?",answer:"- These methods can be used as a hint to the JVM, in order to start a garbage collection. \n\n- However, this it is up to the Java Virtual\nMachine (JVM) to start the garbage collection immediately or later in time.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LV=new A.r(7,{id:1677343401257,question:"What is structure of Java Heap ? What is Perm Gen space in Heap?",answer:"- The JVM has a heap that is the runtime data area from which memory for all class instances and arrays is allocated. \n- It is created\nat the JVM start-up. Heap memory for objects is reclaimed by an automatic memory management system which is known as a\ngarbage collector. \n- Heap memory consists of live and dead objects. Live objects are accessible by the application and will not\nbe a subject of garbage collection. \n- Dead objects are those which will never be accessible by the application, but have not been\ncollected by the garbage collector yet.\n- Such objects occupy the heap memory space until they are eventually collected by the\ngarbage collector.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.N1=new A.r(7,{id:1677343456764,question:"What is the difference between Serial and Throughput Garbage collector?",answer:"- The throughput garbage collector uses a parallel version of the young generation collector and is meant to be used with applications that have medium to large data sets.\n-  On the other hand, the serial collector is usually adequate for most small applications\n(those requiring heaps of up to approximately 100MB on modern processors)\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Os=new A.r(7,{id:1677343492582,question:"When does an Object becomes eligible for Garbage collection in Java?",answer:"A Java object is subject to garbage collection when it becomes unreachable to the program in which it is currently used.",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nq=new A.r(7,{id:1677343542969,question:"Does Garbage collection occur in permanent generation space in JVM ?",answer:"- Garbage Collection does occur in PermGen space and if PermGen space is full or cross a threshold, it can trigger a full garbage\ncollection.\n-  If you look carefully at the output of the garbage collector, you will find that PermGen space is also garbage collected.\n- This is the reason why correct sizing of PermGen space is important to avoid frequent full garbage collections. Also check our\narticle Java 8: PermGen to Metaspace.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ml=new A.r(7,{id:1677343691326,question:"What are the two types of Exceptions in Java ? Which are the differences between them?",answer:"        \n- Java has two types of exceptions: checked exceptions and unchecked exceptions. \n- Unchecked exceptions do not need to be\ndeclared in a method or a constructor\u2019s throws clause, if they can be thrown by the execution of the method or the constructor,\nand propagate outside the method or constructor boundary. \n- On the other hand, checked exceptions must be declared in a method\nor a constructor\u2019s throws clause. See here for tips on Java exception handling\n\n    ",category:"Java",topic:"Exception Handling",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NQ=new A.r(7,{id:1677343760644,question:"What is the difference between Exception and Error in Java?",answer:"        \n- **Exception** and **Error** classes are both subclasses of the Throwable class. \n- The Exception class is used for exceptional conditions\nthat a user\u2019s program should catch.\n- The Error class defines exceptions that are not excepted to be caught by the user program.\n\n    ",category:"Java",topic:"Exception Handling",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LH=new A.r(7,{id:1677343811781,question:"What is the difference between throw and throws?",answer:"        \n- The throw keyword is used to explicitly raise a exception within the program.\n-  On the contrary, the throws clause is used to\nindicate those exceptions that are not handled by a method. \n- Each method must explicitly specify which exceptions does not\nhandle, so the callers of that method can guard against possible exceptions. \n- Finally, multiple exceptions are separated by a\ncomma.\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nu=new A.r(7,{id:1677343954432,question:"What is the importance of finally block in exception handling?",answer:"        \n- A finally block will always be executed, whether or not an exception is actually thrown. \n- Even in the case where the catch\nstatement is missing and an exception is thrown, the finally block will still be executed. \n- Last thing to mention is that the finally\nblock is used to release resources like I/O buffers, database connections, etc.\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.OC=new A.r(7,{id:1677344024413,question:"What is an Applet in Java?",answer:"        \n- A Java applet is program that can be included in a HTML page and be executed in a java enabled client browser.\n- Applets are used\nfor creating dynamic and interactive web applications.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.O7=new A.r(7,{id:1677344073991,question:" Explain the life cycle of an Applet.",answer:"        \nAn applet may undergo the following states:\n\n\u2022 **Init**: An applet is initialized each time is loaded.\n\n\u2022 **Start**: Begin the execution of an applet.\n\n\u2022 **Stop**: Stop the execution of an applet.\n\n\u2022 **Destroy**: Perform a final cleanup, before unloading the applet.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Oz=new A.r(7,{id:1677344150415,question:"What are the restrictions imposed on Java applets?",answer:"        \nMostly due to security reasons, the following restrictions are imposed on Java applets:\n\n- An applet cannot load libraries or define native methods.\n\n- An applet cannot ordinarily read or write files on the execution host.\n\n- An applet cannot read certain system properties.\n\n- An applet cannot make network connections except to the host that it came from.\n\n- An applet cannot start any program on the host that\u2019s executing it.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MG=new A.r(7,{id:1677344211390,question:"What is the difference between applets loaded over the internet and applets loaded via the file system?",answer:"        \n- Regarding the case where an applet is loaded over the internet, the applet is loaded by the applet classloader and is subject to the\nrestrictions enforced by the applet security manager. \n- Regarding the case where an applet is loaded from the client\u2019s local disk,\nthe applet is loaded by the file system loader. \n- Applets loaded via the file system are allowed to read files, write files and to load\nlibraries on the client. \n- Also, applets loaded via the file system are allowed to execute processes and finally, applets loaded via the file system are not passed through the byte code verifier.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MK=new A.r(7,{id:1677344293106,question:"What is the applet class loader, and what does it provide?",answer:"        \n- When an applet is loaded over the internet, the applet is loaded by the applet classloader. \n- The class loader enforces the Java name\nspace hierarchy. \n- Also, the class loader guarantees that a unique namespace exists for classes that come from the local file system,\nand that a unique namespace exists for each network source. \n- When a browser loads an applet over the net, that applet\u2019s classes\nare placed in a private namespace associated with the applet\u2019s origin. \n- Then, those classes loaded by the class loader are passed\nthrough the verifier.The verifier checks that the class file conforms to the Java language specification. \n- Among other things, the\nverifier ensures that there are no stack overflows or underflows and that the parameters to all bytecode instructions are correct.\n\n    ",category:"Java",topic:"Applets",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Ol=new A.r(7,{id:1677344350319,question:"What is the applet security manager, and what does it provide?",answer:"        \n- The applet security manager is a mechanism to impose restrictions on Java applets. \n- A browser may only have one security\nmanager. \n- The security manager is established at startup, and it cannot thereafter be replaced, overloaded, overridden, or extended.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MH=new A.r(7,{id:1677344426771,question:"What is the difference between a Choice and a List?",answer:"        \n- A Choice is displayed in a compact form that must be pulled down, in order for a user to be able to see the list of all available\nchoices. \n- Only one item may be selected from a Choice. \n- A List may be displayed in such a way that several List items are visible.\n- A List supports the selection of one or more List items.\n\n    ",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Oc=new A.r(7,{id:1677344499243,question:"What is the difference between a Scrollbar and a JScrollPane?",answer:"        \n- A **Scrollbar** is a Component, but not a Container. \n- A **ScrollPane** is a Container. \n- A ScrollPane handles its own events and performs\nits own scrolling.\n\n    ",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
