B.MS=new A.r(7,{id:1677344584794,question:"What is the relationship between an event-listener interface and an eventadapter class?",answer:"\n- An event-listener interface defines the methods that must be implemented by an event handler for a particular event. \n- An event\nadapter provides a default implementation of an event-listener interface.\n",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.N9=new A.r(7,{id:1677344621098,question:"What advantage do Java\u2019s layout managers provide over traditional windowing systems?",answer:"\n- Java uses layout managers to lay out components in a consistent manner, across all windowing platforms. \n- Since layout managers aren\u2019t tied to absolute sizing and positioning, they are able to accomodate platform-specific differences among windowing\nsystems.\n",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Ok=new A.r(7,{id:1677344741504,question:"What is JDBC? Explain the role of Driver in JDBC.",answer:"**JDBC**\n- It is an abstraction layer that allows users to choose between databases. \n- JDBC enables developers to write database applications in Java, without having to concern themselves with the underlying details of a particular database\n\n**Role of Driver**\n- The JDBC Driver provides vendor-specific implementations of the abstract classes provided by the JDBC API. \n- Each driver\nmust provide implementations for the following classes of the java.sql package:Connection, Statement, PreparedStatement,\nCallableStatement, ResultSet and Driver.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.LL=new A.r(7,{id:1677344849281,question:"What is the purpose Class.forName method?",answer:"\nThis method is used to method is used to load the driver that will establish a connection to the database.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Mn=new A.r(7,{id:1677344901730,question:"What is the advantage of PreparedStatement over Statement?",answer:"\n- PreparedStatements are precompiled and thus, their performance is much better. \n- Also, PreparedStatement objects can be reused\nwith different input values to their queries.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.M0=new A.r(7,{id:1677344975438,question:"What is the use of CallableStatement ? Name the method, which is used to prepare a CallableStatement.",answer:"\n- A CallableStatement is used to execute stored procedures. \n- Stored procedures are stored and offered by a database. \n- Stored procedures may take input values from the user and may return a result. \n- The usage of stored procedures is highly encouraged,\nbecause it offers security and modularity.\n- The method that prepares a CallableStatement is the following: \n```\nCallableStament.prepareCall();\n```",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MW=new A.r(7,{id:1677345031826,question:"What does Connection pooling mean?",answer:"\n- The interaction with a database can be costly, regarding the opening and closing of database connections. \n- Especially, when the\nnumber of database clients increases, this cost is very high and a large number of resources is consumed.\n- A pool of database\nconnections is obtained at start up by the application server and is maintained in a pool. \n- A request for a connection is served by a\nconnection residing in the pool. \n- In the end of the connection, the request is returned to the pool and can be used to satisfy future\nrequests.\n",category:"Java",topic:"JDBC",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Ms=new A.r(7,{id:1677345326472,question:"What is RMI?",answer:"\n- The Java Remote Method Invocation (Java RMI) is a Java API that performs the object-oriented equivalent of remote procedure\ncalls (RPC), with support for direct transfer of serialized Java classes and distributed garbage collection. \n- Remote Method Invocation (RMI) can also be seen as the process of activating a method on a remotely running object. \n- RMI offers location transparency\nbecause a user feels that a method is executed on a locally running object. C\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MA=new A.r(7,{id:1677345367674,question:"What is the basic principle of RMI architecture?",answer:"\n- The RMI architecture is based on a very important principle which states that the definition of the behavior and the implementation of that behavior, are separate concepts. \n- RMI allows the code that defines the behavior and the code that implements the\nbehavior to remain separate and to run on separate JVMs\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.O_=new A.r(7,{id:1677345423440,question:"What are the layers of RMI Architecture?",answer:"\nThe RMI architecture consists of the following layers:\n\n\u2022 **Stub and Skeleton layer**: This layer lies just beneath the view of the developer. This layer is responsible for intercepting\nmethod calls made by the client to the interface and redirect these calls to a remote RMI Service.\n\n\u2022 **Remote Reference Layer**: The second layer of the RMI architecture deals with the interpretation of references made from\nthe client to the server\u2019s remote objects. This layer interprets and manages references made from clients to the remote service\nobjects. The connection is a one-to-one (unicast) link.\n\n\u2022 **Transport layer**: This layer is responsible for connecting the two JVM participating in the service. This layer is based on\nTCP/IP connections between machines in a network. It provides basic connectivity, as well as some firewall penetration\nstrategies.\n",category:"Android",topic:"Remote Method Invocation",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Or=new A.r(7,{id:1677345478968,question:"What is the role of Remote Interface in RMI?",answer:"\n- The Remote interface serves to identify interfaces whose methods may be invoked from a non-local virtual machine. \n- Any object\nthat is a remote object must directly or indirectly implement this interface. \n- A class that implements a remote interface should\ndeclare the remote interfaces being implemented, define the constructor for each remote object and provide an implementation\nfor each remote method in all remote interfaces.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.OH=new A.r(7,{id:1677345533950,question:"What is the difference between using bind() and rebind() methods of Naming Class?",answer:"\n- The bind method bind is responsible for binding the specified name to a remote object, while the rebind method is responsible\nfor rebinding the specified name to a new remote object. \n- In case a binding exists for that name, the binding is replaced.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NM=new A.r(7,{id:1677345592169,question:"What are the steps involved to make work a RMI program?",answer:"\nThe following steps must be involved in order for a RMI program to work properly:\n\n\u2022 Compilation of all source files.\n\n\u2022 Generatation of the stubs using rmic.\n\n\u2022 Start the rmiregistry.\n\n\u2022 Start the RMIServer.\n\n\u2022 Run the client program.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.LS=new A.r(7,{id:1677345676190,question:"What is the role of stub in RMI?",answer:"\nA stub for a remote object acts as a client\u2019s local representative or proxy for the remote object. The caller invokes a method on\nthe local stub, which is responsible for executing the method on the remote object. When a stub\u2019s method is invoked, it undergoes\nthe following steps:\n\n\u2022 It initiates a connection to the remote JVM containing the remote object.\n\n\u2022 It marshals the parameters to the remote JVM.\n\n\u2022 It waits for the result of the method invocation and execution.\n\n\u2022 It unmarshals the return value or an exception if the method has not been successfully \nexecuted.\n\n\u2022 It returns the value to the caller\n",category:"Java",topic:"Remote Method Invocation",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Na=new A.r(7,{id:1677345731608,question:"What is DGC? And how does it work?",answer:"\n- DGC stands for Distributed Garbage Collection. Remote Method Invocation (RMI) uses DGC for automatic garbage collection.\n- Since RMI involves remote object references across JVM\u2019s, garbage collection can be quite difficult. \n- DGC uses a reference\ncounting algorithm to provide automatic memory management for remote objects.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ng=new A.r(7,{id:1677345779811,question:"What is the purpose of using RMISecurityManager in RMI?",answer:"\n- RMISecurityManager provides a security manager that can be used by RMI applications, which use downloaded code. \n- The class\nloader of RMI will not download any classes from remote locations, if the security manager has not been set.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.O0=new A.r(7,{id:1677345831996,question:"Explain Marshalling and demarshalling.",answer:"\n- When an application wants to pass its memory objects across a network to another host or persist it to storage, the in-memory\nrepresentation must be converted to a suitable format. \n- This process is called marshalling and the revert operation is called\ndemarshalling.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ma=new A.r(7,{id:1677345884121,question:"Explain Serialization and Deserialization.",answer:"\n- Java provides a mechanism, called object serialization where an object can be represented as a sequence of bytes and includes\nthe object\u2019s data, as well as information about the object\u2019s type, and the types of data stored in the object. \n- Thus, serialization can\nbe seen as a way of flattening objects, in order to be stored on disk, and later, read back and reconstituted. \n- Deserialisation is the\nreverse process of converting an object from its flattened state to a live object.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.LM=new A.r(7,{id:1677346023513,question:"What is a Servlet? Explain the architecture of a Servlet.",answer:"**Servlets**\n\n- The servlet is a Java programming language class used to process client requests and generate dynamic web content. \n- Servlets are\nmostly used to process or store data submitted by an HTML form, provide dynamic content and manage state information that\ndoes not exist in the stateless HTTP protocol.\n\n**Architecture**\n\n- The core abstraction that must be implemented by all servlets is the javax.servlet.Servlet interface. \n- Each servlet must implement\nit either directly or indirectly, either by extending javax.servlet.GenericServlet or javax.servlet.http.HTTPServlet. \n- Finally, each\nservlet is able to serve multiple requests in parallel using multithreading.\n",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NX=new A.r(7,{id:1677398116602,question:"What is the difference between an Applet and a Servlet?",answer:"\n- An Applet is a client side java program that runs within a Web browser on the client machine. - On the other hand, a servlet is a server side component that runs on the web server.\n- An applet can use the user interface classes, while a servlet does not have a user interface. \n- Instead, a servlet waits for client\u2019s HTTP requests and generates a response in every request.        \n\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mj=new A.r(7,{id:1677398188669,question:"What is the difference between GenericServlet and HttpServlet?",answer:"        \n- GenericServlet is a generalized and protocol-independent servlet that implements the Servlet and ServletConfig interfaces. \n- Those servlets extending the GenericServlet class shall override the service method. \n- Finally, in order to develop an HTTP servlet for use on the Web that serves requests using the HTTP protocol, your servlet must extend the HttpServlet instead.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OL=new A.r(7,{id:1677398295857,question:"Explain the life cycle of a Servlet.",answer:"        \n- On every client\u2019s request, the Servlet Engine loads the servlets and invokes its init methods, in order for the servlet to be initialized. \n- Then, the Servlet object handles all subsequent requests coming from that client, by invoking the service method for each request separately. \n- Finally, the servlet is removed by calling the server\u2019s destroy method.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mu=new A.r(7,{id:1677398405803,question:"What is the difference between doGet() and doPost()?",answer:"        \n**doGET**: The GET method appends the name-value pairs on the request\u2019s URL. Thus, there is a limit on the number of characters and subsequently on the number of values that can be used in a client\u2019s request. Furthermore, the values of the request are made visible and thus, sensitive information must not be passed in that way.\n\n**doPOST**: The POST method overcomes the limit imposed by the GET request, by sending the values of the request inside its body. Also, there is no limitations on the number of values to be sent across. Finally, the sensitive information passed through a POST request is not visible to an external client.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NC=new A.r(7,{id:1677398490341,question:"What is the structure of the HTTP response?",answer:"        \nThe HTTP response consists of three parts:\n\n\u2022 **Status Code**: describes the status of the response. It can be used to check if the request has been successfully completed. In case the request failed, the status code can be used to find out the reason behind the failure. If your servlet does not return a status code, the success status code, HttpServletResponse.SC_OK, is returned by default.\n\n\u2022 **HTTP Headers**: they contain more information about the response. For example, the headers may specify the date/time after which the response is considered stale, or the form of encoding used to safely transfer the entity to the user.\n\n\u2022 **Body**: it contains the content of the response. The body may contain HTML code, an image, etc. The body consists of the data bytes transmitted in an HTTP transaction message immediately following the headers.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MZ=new A.r(7,{id:1677398568933,question:"What is a cookie? What is the difference between session and cookie?",answer:"        \n\nA cookie is a bit of information that the Web server sends to the browser. The browser stores the cookies for each Web server in a local file. In a future request, the browser, along with the request, sends all stored cookies for that specific Web server.The differences between session and a cookie are the following:\n\n\u2022 The session should work, regardless of the settings on the client browser. The client may have chosen to disable cookies. However, the sessions still work, as the client has no ability to disable them in the server side.\n\n\u2022 The session and cookies also differ in the amount of information the can store. The HTTP session is capable of storing any Java object, while a cookie can only store String objects\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ov=new A.r(7,{id:1677398641874,question:"What\u2019s the difference between sendRedirect and forward methods?",answer:"        \n- The sendRedirect method creates a new request, while the forward method just forwards a request to a new target. \n- The previous request scope objects are not available after a redirect, because it results in a new request. \n- On the other hand, the previous request scope objects are available after forwarding.\n-  FInally, in general, the sendRedirect method is considered to be slower compare to the forward method.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OG=new A.r(7,{id:1677398837295,question:"What is a JSP Page? ",answer:"        \n- A Java Server Page (JSP) is a text document that contains two types of text: static data and JSP elements. \n- Static data can be expressed in any text-based format, such as HTML or XML. JSP is a technology that mixes static content with dynamically- generated content.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NA=new A.r(7,{id:1677398898406,question:"What are the advantages of JSP?",answer:"        \nThe advantages of using the JSP technology are shown below:\n\n\u2022 JSP pages are dynamically compiled into servlets and thus, the developers can easily make updates to presentation code.\n\n\u2022 JSP pages can be pre-compiled.\n\n\u2022 JSP pages can be easily combined to static templates, including HTML or XML fragments, with code that generates dynamic content.\n\n\u2022 Developers can offer customized JSP tag libraries that page authors access using an XML-like syntax.\n\n\u2022Developerscanmakelogicchangesatthecomponentlevel,withouteditingtheindividualpagesthatusetheapplication\u2019slogic.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mv=new A.r(7,{id:1677399114748,question:"What are Directives? What are the different types of Directives available in JSP?",answer:"\n- Directives are instructions that are processed by the JSP engine, when the page is compiled to a servlet. \n- Directives are used to setpage-level instructions,insert data from external files, and specify custom tag libraries.\n- Directives are defined between < %@ and % >.\n- The different types of directives are shown below:\n\n- Include directive: it is used to include a file and merges the content of the file with the current page. \n\n- Page directive: it is used to define specific attributes in the JSP page, like error page and buffer.\n\n- Taglib: it is used to declare a custom tag library which is used in the page.\n",category:"Java",topic:"JSP",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Np=new A.r(7,{id:1677399190029,question:"What are JSP actions?",answer:"        \nJSP actions use constructs in XML syntax to control the behavior of the servlet engine. JSP actions are executed when a JSP page is requested. \n\nThey can be dynamically inserted into a file, re-use JavaBeans components, forward the user to another page, or generate HTML for the Java plugin.\nSome of the available actions are listed below:\n\n\u2022 jsp:include - includes a file, when the JSP page is requested. \n\n\u2022 jsp:useBean - finds or instantiates a JavaBean.\n\n\u2022 jsp:setProperty - sets the property of a JavaBean.\n\n\u2022 jsp:getProperty - gets the property of a JavaBean.\n\n\u2022 jsp:forward - forwards the requester to a new page. \n\n\u2022 jsp:plugin - generates browser-specific code.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OR=new A.r(7,{id:1677399386872,question:"Explain Scriptlets, Decalarations, Expressions.",answer:"      \n**Scriptlets-**  In Java Server Pages (JSP) technology, a scriptlet is a piece of Java-code embedded in a JSP page. The scriptlet is everything inside the tags. Between these tags, a user can add any valid scriplet.\n\n**Decalarations-**\nDeclarations are similar to variable declarations in Java. Declarations are used to declare variables for subsequent use in expres- sions or scriptlets. To add a declaration, you must use the sequences to enclose your declarations.\n\n**Expressions-**\nA JSP expression is used to insert the value of a scripting language expression, converted into a string, into the data stream returned to the client, by the webserver. Expressions are defined between < %  = and % > tags.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ot=new A.r(7,{id:1677399468998,question:"What is meant by implicit objects and what are they?",answer:"        \nJSP implicit objects are those Java objects that the JSP Container makes available to developers in each page. \n\nA developer can call them directly, without being explicitly declared. JSP Implicit Objects are also called pre-defined variables.The following objects are considered implicit in a JSP page:\n\n\u2022 application \n\n\u2022 page\n\n\u2022 request\n\n\u2022 response    \n\n\u2022 session\n\n\u2022 exception\n\n\u2022 out\n\n\u2022 config\n\n\u2022 pageContext",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
